        <S.FooterWrapper>
            <S.LogoWrapper>
                <img src="/assets/img/logo-w.svg" alt="MungPick 로고" />
            </S.LogoWrapper>

            <div>
                <Text.Body1>@MUNG_PICK</Text.Body1>
                <Text.Body3>@2025 MUNGPICK.All rights reserved.</Text.Body3>
            </div>

            <div>

            </div>
        </S.FooterWrapper>
    );
};

export default Footer;
